const BASE_URL = 'https://www.random.org/integers/?num=1&min=1&max=10&col=1&base=10&format=plain&rnd=new';


export async function getNumber() {
  await fetch(BASE_URL)
    .then(response => response.json())
    .then(result => {
      console.log(result);
      return result;
    })

}
